import React from 'react';


const DrumVisualizer = (props) => {
    {props.playList === 'BANK 1' && props.keyPressed!=='' ? 
                playlistOne.filter(x => x.key === props.keyPressed)[0].id : 
                props.keyPressed!==''? playlistTwo.filter(x => x.key === props.keyPressed)[0].id: ''}
}

export default DrumVisualizer;
